switch (msg.guild.verificationLevel) {
   case 0: "None"; break;
   case 1: "Low"; break;
   case 2: "Medium"; break;
   case 3: "(╯°□°）╯︵ ┻━┻"; break;
   case 4: "┻━┻︵ \ (°□°）/ ︵ ┻━┻"; break;
 }

switch (msg.guild.explicitContentFilter) {
  case 0: "Don't scan any messages"; break;
  case 1: "Scan messages from members without a role"; break;
  case 2: "scan messages sent by all members"; break;
}

var cd = new Date(msg.guild.createdAt);
var year = cd.getFullYear();
var month = cd.getMonth();
var date = cd.getDate();
var hours = cd.getHours();
var min = cd.getMinutes();
let cdate = year + "." + month + "." + date + " " + hours + ":" + min;

actions.message:
**Emojis:** ${msg.guild.emojis.array().length}
